export default function HomePage({ navigation, ...props }) {
    const [modalVisible, setModalVisible] = useState(false);
    const [image, setImage] = useState(null);
    const [location, setLocation] = useState(null);
    const [reviewText, updateReviewText] = useState("");

    function updateReviewTextBtn(eneteredText) {
        updateReviewText(eneteredText);
    }

    async function createPostSendReq() {

        console.log(location);


        let location_coords = {
            latitude: JSON.stringify(location.coords.latitude),
            longitude: JSON.stringify(location.coords.longitude),
        };

        const response = await createPost(
            location_coords,
            reviewText,
            image,
            props.route.params.data.uuid
        );
        
        if(response.status == 200) {
            
        }
    }

    function setModalVisibleBtn() {
        setModalVisible(true);
    }

    function closeModalFunc() {
        setImage(null);
        setModalVisible(false);
    }

    const getLocation = async () => {
        let { status } = await Location.requestForegroundPermissionsAsync();
        if (status !== "granted") {
            alert("Permission to access location was denied");
            return;
        }

        let locationData = await Location.getCurrentPositionAsync({accuracy: Location.Accuracy.Low});
        setLocation(locationData);
        createPostSendReq();
    };

    async function showPhotoOnClick() {
        let result = await ImagePicker.launchImageLibraryAsync({
            mediaTypes: ImagePicker.MediaTypeOptions.All,
            allowsEditing: true,
            aspect: [4, 3],
            quality: 1,
            base64: true,
        });

        if (!result.canceled) {
            setImage(result.assets[0].uri);

            if (result.assets[0].base64) {
                setImage("data:image/jpeg;base64," + result.assets[0].base64);
            } else {
                alert("Please select a different image");
            }
        }
    }

    let database = [
        {
            index: 0,
            username: "lukeskywalker69",
            initials: "LS",
            date: "1/14/23",
            location: "333 Christian St",
            description:
                "This is a description of the snow spot. It was very cool and I liked it",
            image: "data:image/jpeg;base64,",
        },
        {
            index: 0,
            username: "cyrusnaficy",
            initials: "CN",
            date: "1/14/23",
            location: "Memorial House",
            description:
                "This is a description of the snow spot. It was very cool and I liked it",
            image: "data:image/jpeg;base64,",
        },
    ];

    let initials = props.route.params.data.full_name.split(" ");
    initials = initials[0][0] + initials[1][0];

    return (
        <TouchableWithoutFeedback onPress={() => Keyboard.dismiss()}>
            <View style={styles.container}>
                <View style={styles.CoverText}>
                    <Text style={styles.snowSpot}>Snowspots Near You...</Text>
                    <TouchableOpacity
                        style={styles.buttonPost}
                        onPress={setModalVisibleBtn}
                    >
                        <Text style={styles.postText}>New Snowspot</Text>
                    </TouchableOpacity>
                </View>
                <Modal
                    animationType="swipe"
                    transparent={true}
                    visible={modalVisible}
                >
                    <TouchableWithoutFeedback
                        onPress={() => Keyboard.dismiss()}
                    >
                        <View style={styles.modalContainer}>
                            <View style={styles.aboveTextWrapper}>
                                <Text style={styles.scaleInitials}>
                                    {initials}
                                </Text>
                                <Text style={styles.scaleUsername}>
                                    {props.route.params.data.username}
                                </Text>
                            </View>
                            <View style={styles.seperateComp} />
                            <View style={styles.textWrapper}>
                                <TextInput
                                    style={styles.reviewTextInput}
                                    placeholder="Write review..."
                                    onChangeText={updateReviewTextBtn}
                                    multiline={true}
                                    autoCorrect={true}
                                    autoCapitalize="none"
                                    value={reviewText}
                                />
                                <Image
                                    source={{ uri: image }}
                                    style={styles.base64Image}
                                />
                            </View>
                            <View style={styles.modalButtonContainer}>
                                <TouchableOpacity
                                    style={styles.uploadImage}
                                    onPress={showPhotoOnClick}
                                >
                                    <Text style={styles.uploadText}>
                                        Upload Photo
                                    </Text>
                                </TouchableOpacity>
                                <TouchableOpacity
                                    style={styles.postButton}
                                    onPress={getLocation}
                                >
                                    <Text style={styles.uploadText}>
                                        Post Review
                                    </Text>
                                </TouchableOpacity>
                                <TouchableOpacity
                                    style={styles.closeModal}
                                    onPress={closeModalFunc}
                                >
                                    <Text style={styles.deleteText}>
                                        Delete
                                    </Text>
                                </TouchableOpacity>
                            </View>
                        </View>
                    </TouchableWithoutFeedback>
                </Modal>
                <View style={styles.postView}>
                    <FlatList
                        data={database}
                        renderItem={(itemData) => {
                            return (
                                <CreatePost
                                    index={itemData.item.index}
                                    username={itemData.item.username}
                                    initials={itemData.item.initials}
                                    date={itemData.item.date}
                                    location={itemData.item.location}
                                    description={itemData.item.description}
                                    image={itemData.item.image}
                                    navigation={props.navigation}
                                />
                            );
                        }}
                        alwaysBounceVertical={false}
                        showsVerticalScrollIndicator={false}
                    />
                </View>
                <View style={styles.bottomBar}>
                    <TouchableOpacity>
                        <View style={styles.profileBox}>
                            <Text style={styles.profileBoxInitials}>
                                {initials}
                            </Text>
                        </View>
                    </TouchableOpacity>
                    <TouchableOpacity>
                        <View style={styles.settingsBox}>
                            <Text style={styles.gearEmoji}>⚙️</Text>
                        </View>
                    </TouchableOpacity>
                </View>
            </View>
        </TouchableWithoutFeedback>
    );
}
